import React from 'react';
import "../../fonts.css";
import "./title.css";

const TitlePage = (() => {
    return (
        <div className='title'>
            <h3 className='pixel'>
                hello world!
                my name is: 
            </h3>

            <h1>
                <span className='cursive'>E</span><span className='pixel'>MILY YU</span>
            </h1>
        </div>
    )
});

export default TitlePage;
